PIA-RE propone in ESCLUSIVA la vendita di questa prestigiosa dimora.
Imperdibile per amanti di abitazioni che godono di grandi terrazzi ed assoluto riserbo nonostante ubicati in zone centralissime.
Le finiture esclusive e l'elegante arredo rendono questo appartamento unico nel suo genere. 
Funzionali gli spazi interni studiati nei minimi particolari.
Siamo al settimo piano di un condominio che offre il servizio di portineria per l'intera giornata e video-sorveglianza H/24.
La superficie utile è in realtà di 170 qm circa, decisamente superiore a quanto indicato, considerato che balconi e terrazzo sono calcolati al 50%: 
- Ingresso su disimpegno con annesso un ripostiglio;
- soggiorno triplo con due zone relax ed una zona pranzo;
- cucina a tutta vista completa di elettrodomestici;
- lavande
